'      .data(links)',
'    .enter().append("path")',
'      .attr("class", "link")',
'      .attr("d", diagonal);',
'',
'  var node = svg.selectAll("g.node")',
'      .data(nodes)',
'    .enter().append("g")',
'      .attr("class", "node")',
'      .attr("transform", function(d) { return "translate(" + d.y + "," + d.x + ")"; })',
'',
'  node.append("circle")',
'      .attr("r", 4.5);',
'',
'  node.append("text")',
'      .attr("dx", function(d) { return d.children ? -8 : 8; })',
'      .attr("dy", 3)',
'      .attr("text-anchor", function(d) { return d.children ? "end" : "start"; })',
