'SELECT "PAGE_ID",',
'  (SELECT APPLICATION_NAME',
'  FROM AD_APPLICATIONS',
'  WHERE APPLICATION_ID = AP.APPLICATION_ID',
'  ) "APPLICATION_ID",',
'  "PAGE_NAME",',
'  "PAGE",',
'  (SELECT PAGE_NAME',
'  FROM APEX_APPLICATION_PAGES',
'  WHERE PAGE_ID      = AP.APEX_PAGE_ID',
'  AND APPLICATION_ID =',
'    (SELECT APEX_APPLICATION_ID',
'    FROM AD_APPLICATIONS',
'    WHERE APPLICATION_ID = AP.APPLICATION_ID',
'    )',
'  ) "APEX_PAGE_ID",',
'  (SELECT ALV.MEANING',
'FROM AD_LOOKUPS AL,',
'  AD_LOOKUP_VALUES ALV',
'WHERE AL.LOOKUP_ID    = ALV.LOOKUP_ID',
'AND AL.LOOKUP         = ''PAGE_TYPES''',
'AND AL.APPLICATION_ID = :AD_APPLICATION_ID',
'AND AL.ENABLED        = ''Y''',
'AND SYSDATE BETWEEN NVL(AL.DATE_FROM, SYSDATE) AND NVL(AL.DATE_TO, SYSDATE)',
'AND ALV.ENABLED = ''Y''',
'AND SYSDATE BETWEEN NVL(ALV.DATE_FROM, SYSDATE) AND NVL(ALV.DATE_TO, SYSDATE)',
'AND ALV.CODE = TO_CHAR(AP.PAGE_TYPE)) "PAGE_TYPE",',
'  "READ_ONLY",',
'  "UNIQUE_NAME_COLUMN",',
'  "PAGE_ICON",',
'  "ENABLED",',
'  "DATE_FROM",',
'  "DATE_TO",',
'  (SELECT USER_NAME FROM AD_USERS WHERE USER_ID = AP.CREATED_BY',
'  ) "CREATED_BY",',
'  "CREATED_ON",',
'  (SELECT USER_NAME FROM AD_USERS WHERE USER_ID = AP.UPDATED_BY',
'  ) "UPDATED_BY",',
'  "UPDATED_ON"',
'FROM "#OWNER#"."AD_PAGES" AP'))
