'DECLARE',
'  li_handle    INTEGER;',
'  ln_var       NUMBER;',
'  li_col_count INTEGER;',
'  lt_rec dbms_sql.desc_tab;',
'BEGIN',
'  IF upper (SUBSTR (ltrim (:p421_query), 0, 6)) = ''SELECT'' THEN',
'    li_handle                                  := dbms_sql.open_cursor;',
'    dbms_sql.parse (li_handle, :p421_query, 1);',
'    ln_var := dbms_sql.execute (li_handle);',
'    dbms_sql.describe_columns (li_handle, li_col_count, lt_rec);',
'    dbms_sql.close_cursor (li_handle);',
'    IF li_col_count <> 2 THEN',
'      RETURN (''Invalid SQL Statement. SQL Statement should contain 2 columns'');',
'    ELSE',
'      RETURN NULL;',
'    END IF;',
'  ELSE',
'    RETURN (''Invalid SQL Statement. SQL Statement should start with SELECT'');',
'  END IF;',
'EXCEPTION',
'WHEN OTHERS THEN',
'  RETURN (sqlerrm);',
'END;'))
