'SELECT AR.REQUEST_ID,',
'  AP.PROCESS_NAME,',
'  AR.JOB,',
'  AR.PARENT,',
'  DECODE(AR.STATUS, 2, ''Cancelled'', INITCAP(APJ.SYSTEM_STATUS)) STATUS,',
'  (SELECT ALV.MEANING',
'  FROM AD_LOOKUPS AL,',
'    AD_LOOKUP_VALUES ALV',
'  WHERE AL.LOOKUP_ID    = ALV.LOOKUP_ID',
'  AND AL.LOOKUP         = ''PROCESS_REQUESTS_SCHEDULE_TYPE''',
'  AND AL.APPLICATION_ID = :AD_APPLICATION_ID',
'  AND AL.ENABLED        = ''Y''',
'  AND SYSDATE BETWEEN NVL(AL.DATE_FROM, SYSDATE) AND NVL(AL.DATE_TO, SYSDATE)',
'  AND ALV.ENABLED = ''Y''',
'  AND SYSDATE BETWEEN NVL(ALV.DATE_FROM, SYSDATE) AND NVL(ALV.DATE_TO, SYSDATE)',
'  AND ALV.CODE = TO_CHAR(AR.SCHEDULE_TYPE)',
'  ) SCHEDULE_TYPE,',
'  AR.INTERVAL,',
'  (SELECT ALV.MEANING',
'  FROM AD_LOOKUPS AL,',
'    AD_LOOKUP_VALUES ALV',
'  WHERE AL.LOOKUP_ID    = ALV.LOOKUP_ID',
'  AND AL.LOOKUP         = ''PROCESS_REQUESTS_INTERVAL_TYPE''',
'  AND AL.APPLICATION_ID = :AD_APPLICATION_ID',
'  AND AL.ENABLED        = ''Y''',
'  AND SYSDATE BETWEEN NVL(AL.DATE_FROM, SYSDATE) AND NVL(AL.DATE_TO, SYSDATE)',
'  AND ALV.ENABLED = ''Y''',
'  AND SYSDATE BETWEEN NVL(ALV.DATE_FROM, SYSDATE) AND NVL(ALV.DATE_TO, SYSDATE)',
'  AND ALV.CODE = TO_CHAR(AR.INTERVAL_TYPE)',
'  ) INTERVAL_TYPE,',
'  AR.DATE_FROM,',
'  AR.DATE_TO,',
'  (SELECT USER_NAME FROM AD_USERS WHERE USER_ID = AR.CREATED_BY',
'  ) CREATED_BY,',
'  AR.CREATED_ON,',
'  (SELECT USER_NAME FROM AD_USERS WHERE USER_ID = AR.UPDATED_BY',
'  ) UPDATED_BY,',
'  AR.UPDATED_ON,',
'  DECODE(UPPER(APJ.SYSTEM_STATUS), ''SUBMITTED'', APEX_ITEM.CHECKBOX(1, AR.REQUEST_ID), '' '') CANCEL_REQUEST_ID',
'FROM AD_REQUESTS AR,',
'  AD_PROCESSES AP,',
'  APEX_PLSQL_JOBS APJ',
'WHERE AR.PROCESS_ID = AP.PROCESS_ID',
'AND AR.JOB          = APJ.JOB(+);'))
