'CREATE OR REPLACE PACKAGE "AD_PROFILE_PKG" ',
'AS',
'  /* ***************************************************************************',
'  -- ------------------------------------------------------------------------',
'  -- Package Name        : AD_PROFILE_PKG',
'  -- Company             : Acolyte',
'  -- Author              : Abhishek Arora',
'  -- ------------------------------------------------------------------------',
'  -- Description...',
'  -- This package contians the code related to profiles tables.',
'  -- ------------------------------------------------------------------------',
'  -- Revision History...',
'  -- -----------  ---------------  ------------------------------------------',
'  -- Date         Author           Change',
'  -- -----------  ---------------  ------------------------------------------',
'  -- 05-AUG-2015  Abhishek         Created Package',
'  -- ------------------------------------------------------------------------',
'  *************************************************************************** */',
'  FUNCTION AD_PROFILE_VALUE(',
'      P_PROFILE_NAME IN VARCHAR2,',
'      P_LEVEL        IN NUMBER,',
'      P_LEVEL_ID     IN NUMBER DEFAULT NULL)',
'    RETURN VARCHAR2;',
'END AD_PROFILE_PKG;',
'/',
'',
'',
'CREATE OR REPLACE PACKAGE BODY "AD_PROFILE_PKG" ',
'AS',
'  /* ***************************************************************************',
'  -- ------------------------------------------------------------------------',
'  -- Function Name       : AD_PROFILE_VALUE',
'  -- ------------------------------------------------------------------------',
'  -- Description...',
'  -- This function returns the value for a given profile and level.',
'  -- ------------------------------------------------------------------------',
'  -- Parameters...',
'  -- ---------------  -----  ------------------------------------------------',
'  -- Paramter Name    Type   Description',
'  -- ---------------  -----  ------------------------------------------------',
'  -- P_PROFILE_NAME   IN     Profile Name',
'  -- P_LEVEL          IN     Level',
'  -- P_LEVEL_ID       IN     Level Id',
'  -- ---------------  -----  ------------------------------------------------',
'  *************************************************************************** */',
'FUNCTION AD_PROFILE_VALUE(',
'    P_PROFILE_NAME IN VARCHAR2,',
'    P_LEVEL        IN NUMBER,',
'    P_LEVEL_ID     IN NUMBER DEFAULT NULL)',
'  RETURN VARCHAR2',
'AS',
'  LV_PROFILE_VALUE AD_PROFILE_VALUES.VALUE%TYPE;',
'BEGIN',
'  -- Select statement to get profile value.',
'  SELECT APV.VALUE',
'  INTO LV_PROFILE_VALUE',
'  FROM AD_PROFILES AP,',
'    AD_PROFILE_VALUES APV',
'  WHERE AP.PROFILE_ID = APV.PROFILE_ID',
'  AND AP.ENABLED      = ''Y''',
'  AND SYSDATE BETWEEN NVL (AP.DATE_FROM, SYSDATE) AND NVL (AP.DATE_TO, SYSDATE)',
'  AND APV.ENABLED = ''Y''',
'  AND SYSDATE BETWEEN NVL (APV.DATE_FROM, SYSDATE) AND NVL (APV.DATE_TO, SYSDATE)',
'  AND AP.PROFILE_NAME       = P_PROFILE_NAME',
'  AND APV.PROFILE_LEVEL     = P_LEVEL',
'  AND (APV.PROFILE_LEVEL_ID = P_LEVEL_ID',
'  OR APV.PROFILE_LEVEL_ID  IS NULL);',
'  -- Return profile value',
'  RETURN (LV_PROFILE_VALUE);',
'EXCEPTION',
'WHEN OTHERS THEN',
'  -- Return null when no value is found',
'  RETURN NULL;',
'END AD_PROFILE_VALUE;',
'END AD_PROFILE_PKG;',
'/',
'',
'CREATE OR REPLACE PACKAGE "AD_PROCESS_PKG" ',
'AS',
'  /* ***************************************************************************',
'  -- ------------------------------------------------------------------------',
'  -- Package Name        : AD_PROCESS_PKG',
'  -- Company             : Acolyte',
'  -- Author              : Abhishek Arora',
'  -- ------------------------------------------------------------------------',
'  -- Description...',
'  -- This package contians the code related to processes.',
'  -- ------------------------------------------------------------------------',
'  -- Revision History...',
'  -- -----------  ---------------  ------------------------------------------',
'  -- Date         Author           Change',
'  -- -----------  ---------------  ------------------------------------------',
'  -- 02-SEP-2015  Abhishek         Created Package',
'  -- ------------------------------------------------------------------------',
'  *************************************************************************** */',
'  PROCEDURE submit_request(',
'      p_request_id NUMBER);',
'  PROCEDURE process_request_manager;',
'  PROCEDURE cancel_request(',
'      p_request_id NUMBER);',
'END ad_process_pkg;',
'/',
'',
'',
'CREATE OR REPLACE PACKAGE BODY "AD_PROCESS_PKG" ',
'AS',
'  /* ***************************************************************************',
'  -- ------------------------------------------------------------------------',
'  -- Function Name       : GET_REQUEST_SQL',
'  -- ------------------------------------------------------------------------',
'  -- Description...',
'  -- This functions returns sql query to be executed in SUBMIT_PROCESS for',
'  -- every request',
'  -- ------------------------------------------------------------------------',
'  -- Parameters...',
'  -- ---------------  -----  ------------------------------------------------',
'  -- Paramter Name    Type   Description',
'  -- ---------------  -----  ------------------------------------------------',
'  -- P_REQUEST_ID     IN     Request ID',
'  -- ---------------  -----  ------------------------------------------------',
'  *************************************************************************** */',
'FUNCTION get_request_sql(',
'    p_request_id NUMBER)',
'  RETURN VARCHAR2',
'AS',
'  CURSOR cur_parameters',
'  IS',
'    SELECT parameter_name,',
'      parameter_value',
'    FROM ad_request_parameters',
'    WHERE request_id = p_request_id;',
'  lv_procedure  VARCHAR2(150);',
'  lv_parameters VARCHAR2(4000);',
'  lv_sql        VARCHAR2(4000);',
'BEGIN',
'  SELECT ap.package',
'    ||DECODE(ap.package, NULL, '''', ''.'')',
'    ||ap.procedure',
'  INTO lv_procedure',
'  FROM ad_processes ap',
'  WHERE ap.process_id =',
'    (SELECT ar.process_id FROM ad_requests ar WHERE ar.request_id = p_request_id',
'    );',
'  FOR rec_parameters IN cur_parameters',
'  LOOP',
'    IF lv_parameters IS NULL THEN',
'      lv_parameters  := rec_parameters.parameter_name || '' => '' || rec_parameters.parameter_value;',
'    ELSE',
'      lv_parameters := lv_parameters || '', '' || rec_parameters.parameter_name || '' => '' || rec_parameters.parameter_value;',
'    END IF;',
'  END LOOP;',
'  IF lv_parameters IS NULL THEN',
'    lv_sql         := lv_procedure || '';'';',
'  ELSE',
'    lv_sql := lv_procedure || ''('' || lv_parameters ||'');'';',
'  END IF;',
'  RETURN lv_sql;',
'EXCEPTION',
'WHEN OTHERS THEN',
'  RETURN NULL;',
'END get_request_sql;',
'/* ***************************************************************************',
'-- ------------------------------------------------------------------------',
'-- Function Name       : GET_RUN_DATE',
'-- ------------------------------------------------------------------------',
'-- Description...',
'-- This functions returns the date when the next request to be executed',
'-- ------------------------------------------------------------------------',
'-- Parameters...',
'-- ---------------  -----  ------------------------------------------------',
'-- Paramter Name    Type   Description',
'-- ---------------  -----  ------------------------------------------------',
'-- P_DATE           IN     Date from which next run date to be calculated',
'-- P_INTERVAL       IN     Interval to be added to date',
'-- P_INTERVAL_TYPE  IN     Interval type used to calculate date',
'-- ---------------  -----  ------------------------------------------------',
'*************************************************************************** */',
'FUNCTION get_run_date(',
'    p_date          DATE,',
'    p_interval      NUMBER,',
'    p_interval_type NUMBER)',
'  RETURN DATE',
'IS',
'  ld_date DATE;',
'BEGIN',
'  IF p_date  > sysdate THEN',
'    ld_date := p_date;',
'  ELSE',
'    ld_date := sysdate;',
'  END IF;',
'  IF p_interval_type = 1 THEN',
'    RETURN (ld_date + p_interval / 24 / 60 / 60);',
'  elsif p_interval_type = 2 THEN',
'    RETURN (ld_date + p_interval / 24 / 60);',
'  elsif p_interval_type = 3 THEN',
'    RETURN (ld_date + p_interval / 24);',
'  elsif p_interval_type = 4 THEN',
'    RETURN (ld_date + p_interval);',
'  elsif p_interval_type = 5 THEN',
'    RETURN (ld_date + p_interval * 7);',
'  elsif p_interval_type = 6 THEN',
'    RETURN (add_months (ld_date, p_interval));',
'  elsif p_interval_type = 7 THEN',
'    RETURN (add_months (ld_date, p_interval * 12));',
'  ELSE',
'    RETURN (ld_date);',
'  END IF;',
'END get_run_date;',
'/* ***************************************************************************',
'-- ------------------------------------------------------------------------',
'-- Procedure Name       : SUBMIT_REQUEST',
'-- ------------------------------------------------------------------------',
'-- Description...',
'-- This procedure creates oracle job to execte the request in AD_REQUESTS',
'-- ------------------------------------------------------------------------',
'-- Parameters...',
'-- ---------------  -----  ------------------------------------------------',
'-- Paramter Name    Type   Description',
'-- ---------------  -----  ------------------------------------------------',
'-- P_REQUEST_ID     IN     Request ID',
'-- ---------------  -----  ------------------------------------------------',
'*************************************************************************** */',
'PROCEDURE submit_request(',
'    p_request_id NUMBER)',
'AS',
'  CURSOR cur_request',
'  IS',
'    SELECT ar.* FROM ad_requests ar WHERE ar.request_id = p_request_id;',
'  CURSOR cur_request_parameters',
'  IS',
'    SELECT arp.*',
'    FROM ad_request_parameters arp',
'    WHERE arp.request_id = p_request_id;',
'  lv_sql           VARCHAR2 (4000);',
'  ln_job           NUMBER;',
'  ln_next_request  NUMBER;',
'  ld_next_run_date DATE;',
'  lv_next_sql      VARCHAR2 (4000);',
'  ln_next_job      NUMBER;',
'BEGIN',
'  FOR rec_request IN cur_request',
'  LOOP',
'    IF rec_request.schedule_type = 1 THEN',
'      lv_sql                    := ''BEGIN '' || get_request_sql (p_request_id) || '' END;'';',
'      ln_job                    := apex_plsql_job.submit_process (p_sql => lv_sql);',
'    END IF;',
'    IF rec_request.schedule_type = 2 THEN',
'      lv_sql                    := ''BEGIN '' || get_request_sql (p_request_id) || '' END;'';',
'      ln_job                    := apex_plsql_job.submit_process ( p_sql => lv_sql, p_when => rec_request.date_from);',
'    END IF;',
'    IF rec_request.schedule_type = 3 THEN',
'      SELECT TO_CHAR(SYSDATE, ''YYYYMMDD'')||LPAD(ad_requests_s.nextval, 7, 0) INTO ln_next_request FROM dual;',
'      ld_next_run_date    := get_run_date (rec_request.date_from, rec_request.interval, rec_request.interval_type);',
'      IF ld_next_run_date <= NVL (rec_request.date_to, ld_next_run_date) THEN',
'        INSERT',
'        INTO ad_requests VALUES',
'          (',
'            ln_next_request,',
'            rec_request.process_id,',
'            NULL,',
'            p_request_id,',
'            1,',
'            rec_request.schedule_type,',
'            rec_request.interval,',
'            rec_request.interval_type,',
'            rec_request.date_from,',
'            rec_request.date_to,',
'            rec_request.created_by,',
'            sysdate,',
'            rec_request.updated_by,',
'            sysdate',
'          );',
'        FOR rec_request_parameters IN cur_request_parameters',
'        LOOP',
'          INSERT',
'          INTO ad_request_parameters VALUES',
'            (',
'              TO_CHAR(SYSDATE, ''YYYYMMDD'')||LPAD(ad_request_parameters_s.nextval, 7, 0),',
'              ln_next_request,',
'              rec_request_parameters.parameter_name,',
'              rec_request_parameters.parameter_value',
'            );',
'        END LOOP;',
'        lv_next_sql    := ''BEGIN AD_PROCESS_PKG.SUBMIT_REQUEST('' || ln_next_request || ''); '' || get_request_sql (p_request_id) || '' END;'';',
'        ln_next_job    := apex_plsql_job.submit_process (p_sql => lv_next_sql, p_when => ld_next_run_date);',
'        IF ln_next_job <> 0 THEN',
'          UPDATE ad_requests SET job = ln_next_job WHERE request_id = ln_next_request;',
'          COMMIT;',
'        END IF;',
'        IF rec_request.parent IS NULL THEN',
'          lv_sql              := ''BEGIN '' || get_request_sql (p_request_id) || '' END;'';',
'          ln_job              := apex_plsql_job.submit_process ( p_sql => lv_sql, p_when => rec_request.date_from);',
'        END IF;',
'      END IF;',
'    END IF;',
'    IF ln_job <> 0 THEN',
'      UPDATE ad_requests SET job = ln_job WHERE request_id = p_request_id;',
'      COMMIT;',
'    END IF;',
'  END LOOP;',
'END submit_request;',
'/* ***************************************************************************',
'-- ------------------------------------------------------------------------',
'-- Procedure Name       : PROCESS_REQUEST_MANAGER',
'-- ------------------------------------------------------------------------',
'-- Description...',
'-- This procedure submit pending requests from AD_REQUESTS',
'-- ------------------------------------------------------------------------',
'-- Parameters...',
'-- ---------------  -----  ------------------------------------------------',
'-- Paramter Name    Type   Description',
'-- ---------------  -----  ------------------------------------------------',
'--',
'-- ---------------  -----  ------------------------------------------------',
'*************************************************************************** */',
'PROCEDURE process_request_manager',
'AS',
'  CURSOR cur_requests',
'  IS',
'    SELECT request_id',
'    FROM ad_requests',
'    WHERE job IS NULL',
'    AND status = 1',
'    AND sysdate BETWEEN NVL (date_from, sysdate) AND NVL (date_to, sysdate);',
'BEGIN',
'  FOR rec_requests IN cur_requests',
'  LOOP',
'    submit_request (rec_requests.request_id);',
'  END LOOP;',
'END process_request_manager;',
'/* ***************************************************************************',
'-- ------------------------------------------------------------------------',
'-- Procedure Name       : CANCEL_REQUEST',
'-- ------------------------------------------------------------------------',
'-- Description...',
'-- This procedure cancels requests in AD_REQUESTS',
'-- ------------------------------------------------------------------------',
'-- Parameters...',
'-- ---------------  -----  ------------------------------------------------',
'-- Paramter Name    Type   Description',
'-- ---------------  -----  ------------------------------------------------',
'-- P_REQUEST_ID     IN     Request ID',
'-- ---------------  -----  ------------------------------------------------',
'*************************************************************************** */',
'PROCEDURE cancel_request(',
'    p_request_id NUMBER)',
'AS',
'  ln_job apex_plsql_jobs.job%type;',
'  ln_request_id ad_requests.request_id%type;',
'BEGIN',
'  SELECT apj.job,',
'    ar.request_id',
'  INTO ln_job,',
'    ln_request_id',
'  FROM ad_requests ar,',
'    apex_plsql_jobs apj',
'  WHERE ar.job          = apj.job',
'  AND apj.system_status = ''SUBMITTED''',
'  AND ar.request_id     = p_request_id;',
'  apex_plsql_job.purge_process (p_job => ln_job);',
'  UPDATE ad_requests SET status = 2 WHERE request_id = ln_request_id;',
'  COMMIT;',
'EXCEPTION',
'WHEN OTHERS THEN',
'  NULL;',
'END cancel_request;',
'END ad_process_pkg;',
'/',
'',
'CREATE OR REPLACE PACKAGE "AD_HISTORY_PKG" ',
'AS',
'  /* ***************************************************************************',
'  -- ------------------------------------------------------------------------',
'  -- Package Name        : AD_HISTORY_PKG',
'  -- Company             : Acolyte',
'  -- Author              : Abhishek Arora',
'  -- ------------------------------------------------------------------------',
'  -- Description...',
'  -- This package contians the code related to historical data.',
'  -- ------------------------------------------------------------------------',
'  -- Revision History...',
'  -- -----------  ---------------  ------------------------------------------',
'  -- Date         Author           Change',
'  -- -----------  ---------------  ------------------------------------------',
'  -- 21-OCT-2015  Abhishek         Created Package',
'  -- ------------------------------------------------------------------------',
'  *************************************************************************** */',
'  PROCEDURE create_history_objects(',
'      p_enable_history IN VARCHAR2);',
'END ad_history_pkg;',
'/',
'',
'',
'CREATE OR REPLACE PACKAGE BODY "AD_HISTORY_PKG" ',
'AS',
'  /* ***************************************************************************',
'  -- ------------------------------------------------------------------------',
'  -- Function Name       : GET_COLUMN_LIST',
'  -- ------------------------------------------------------------------------',
'  -- Description...',
'  -- This function returns the list of columns for a given table to used',
'  -- while creating trigger',
'  -- ------------------------------------------------------------------------',
'  -- Parameters...',
'  -- ---------------  -----  ------------------------------------------------',
'  -- Paramter Name    Type   Description',
'  -- ---------------  -----  ------------------------------------------------',
'  -- P_TABLE_NAME     IN     Name of table for which column list is prepared',
'  -- P_OLD_NEW        IN     1-NEW|2-OLD',
'  -- ---------------  -----  ------------------------------------------------',
'  *************************************************************************** */',
'FUNCTION get_column_list(',
'    p_table_name VARCHAR2,',
'    p_old_new    NUMBER)',
'  RETURN VARCHAR2',
'AS',
'  -- Cursor to fetch the columns list',
'  CURSOR cur_cols',
'  IS',
'    SELECT column_name',
'    FROM all_tab_cols',
'    WHERE table_name = p_table_name',
'    ORDER BY column_id;',
'  lv_old_new  VARCHAR2(4);',
'  lv_col_list VARCHAR2(2000);',
'BEGIN',
'  -- If procedure is called for NEW values',
'  IF p_old_new  = 1 THEN',
'    lv_old_new := '':NEW'';',
'    -- If procedure is called for OLD values',
'  ELSE',
'    lv_old_new := '':OLD'';',
'  END IF;',
'  -- Loop for all columns in table',
'  FOR rec_cols IN cur_cols',
'  LOOP',
'    -- If columns is UPDATED_BY',
'    IF p_old_new  <> 1 AND rec_cols.column_name = ''UPDATED_BY'' THEN',
'      lv_col_list := lv_col_list||'', ''||''LN_USER_ID'';',
'      -- If column is UPDATED_ON',
'    elsif p_old_new <> 1 AND rec_cols.column_name = ''UPDATED_ON'' THEN',
'      lv_col_list   := lv_col_list||'', ''||''SYSDATE'';',
'      -- All other columns',
'    ELSE',
'      lv_col_list := lv_col_list||'', ''||lv_old_new||''.''||rec_cols.column_name;',
'    END IF;',
'  END LOOP;',
'  -- Return column list',
'  RETURN lv_col_list;',
'END get_column_list;',
'/* ***************************************************************************',
'-- ------------------------------------------------------------------------',
'-- Procedure Name       : CREATE_HISTORY_OBJECTS',
'-- ------------------------------------------------------------------------',
'-- Description...',
'-- This procedure enables or disables historical data creation',
'-- ------------------------------------------------------------------------',
'-- Parameters...',
'-- ---------------  -----  ------------------------------------------------',
'-- Paramter Name    Type   Description',
'-- ---------------  -----  ------------------------------------------------',
'-- P_ENABLE_HISTORY IN     Y-Enable History|Null-Disable History',
'-- ---------------  -----  ------------------------------------------------',
'*************************************************************************** */',
'PROCEDURE create_history_objects(',
'    p_enable_history IN VARCHAR2)',
'AS',
'  -- Cursor to fetch table names from lookup which are enabled',
'  CURSOR cur_tables_enabled',
'  IS',
'    SELECT meaning table_name',
'    FROM ad_lookup_values alv,',
'      ad_lookups al',
'    WHERE al.lookup_id = alv.lookup_id',
'    AND al.enabled     = ''Y''',
'    AND sysdate BETWEEN NVL (al.date_from, sysdate) AND NVL (al.date_to, sysdate)',
'    AND alv.enabled = ''Y''',
'    AND sysdate BETWEEN NVL (alv.date_from, sysdate) AND NVL (alv.date_to, sysdate)',
'    AND al.lookup = ''HISTORY_TABLES_LIST''',
'    ORDER BY to_number(code);',
'  -- Cursor to fetch table names from lookup which are disabled',
'  CURSOR cur_tables_disabled',
'  IS',
'    SELECT meaning table_name',
'    FROM ad_lookup_values alv,',
'      ad_lookups al',
'    WHERE al.lookup_id = alv.lookup_id',
'    AND al.enabled     = ''Y''',
'    AND sysdate BETWEEN NVL (al.date_from, sysdate) AND NVL (al.date_to, sysdate)',
'    AND alv.enabled IS NULL',
'    AND sysdate BETWEEN NVL (alv.date_from, sysdate) AND NVL (alv.date_to, sysdate)',
'    AND al.lookup = ''HISTORY_TABLES_LIST''',
'    ORDER BY to_number(code);',
'  ln_count NUMBER;',
'  lv_query VARCHAR2(20000);',
'BEGIN',
'  -- Check if history sequence exists',
'  SELECT COUNT(1)',
'  INTO ln_count',
'  FROM all_sequences',
'  WHERE sequence_name = ''AD_HISTORY_S'';',
'  -- If sequence doesnt exists',
'  IF ln_count = 0 THEN',
'    -- Create sequence',
'    lv_query := ''CREATE SEQUENCE AD_HISTORY_S START WITH 1 INCREMENT BY 1'';',
'    EXECUTE immediate lv_query;',
'  END IF;',
'  -- If the procedure is execute to enable history',
'  IF NVL(p_enable_history, ''N'') = ''Y'' THEN',
'    -- Open cursor for tables names',
'    FOR rec_tables_enabled IN cur_tables_enabled',
'    LOOP',
'      -- Check if table exists',
'      SELECT COUNT(1)',
'      INTO ln_count',
'      FROM all_tables',
'      WHERE table_name = rec_tables_enabled.table_name;',
'      -- If table exists',
'      IF ln_count > 0 THEN',
'        -- Check if history table exists',
'        SELECT COUNT(1)',
'        INTO ln_count',
'        FROM all_tables',
'        WHERE table_name = rec_tables_enabled.table_name',
'          ||''_'';',
'        -- If history table doesnt exists',
'        IF ln_count = 0 THEN',
'          -- Create history table',
'          lv_query := ''CREATE TABLE ''||rec_tables_enabled.table_name||''_ AS SELECT 1 HISTORY_ID, AD.* FROM ''||rec_tables_enabled.table_name||'' AD WHERE 1=2'';',
'          EXECUTE immediate lv_query;',
'        END IF;',
'      END IF;',
'      -- Check trigger exists',
'      SELECT COUNT(1)',
'      INTO ln_count',
'      FROM all_triggers',
'      WHERE trigger_name = rec_tables_enabled.table_name',
'        ||''_TRG''',
'      AND table_name = rec_tables_enabled.table_name;',
'      -- If trigger exists',
'      IF ln_count > 0 THEN',
'        -- Check if trigger is Enabled or Disabled',
'        SELECT COUNT(1)',
'        INTO ln_count',
'        FROM all_triggers',
'        WHERE trigger_name = rec_tables_enabled.table_name',
'          ||''_TRG''',
'        AND table_name = rec_tables_enabled.table_name',
'        AND status     = ''DISABLED'';',
'        -- If trigger is disabled',
'        IF ln_count > 0 THEN',
'          -- Enable trigger',
'          lv_query := ''ALTER TRIGGER ''||rec_tables_enabled.table_name||''_TRG ENABLE'';',
'          EXECUTE immediate lv_query;',
'        END IF;',
'        -- If trigger doesnt exists',
'      ELSE',
'        -- Create Trigger',
'        lv_query := ''CREATE OR REPLACE TRIGGER '' || rec_tables_enabled.table_name|| ''_TRG AFTER INSERT OR UPDATE OR DELETE ON '' || rec_tables_enabled.table_name || '' FOR EACH ROW DECLARE LN_USER_ID NUMBER; BEGIN IF INSERTING OR UPDATING THEN INSERT I'
||'NTO '' || rec_tables_enabled.table_name||''_ VALUES (TO_CHAR(SYSDATE, ''''YYYYMMDD'''')||LPAD(AD_HISTORY_S.NEXTVAL, 7, 0)''|| get_column_list(rec_tables_enabled.table_name, 1)||''); ELSE SELECT USER_ID INTO LN_USER_ID FROM AD_USERS WHERE USER_NAME = UPPER(V('
||'''''APP_USER'''')); INSERT INTO '' || rec_tables_enabled.table_name||''_ VALUES (TO_CHAR(SYSDATE, ''''YYYYMMDD'''')||LPAD(AD_HISTORY_S.NEXTVAL, 7, 0)''|| get_column_list(rec_tables_enabled.table_name, 2)||''); END IF; EXCEPTION WHEN OTHERS THEN NULL; END;'';',
'        EXECUTE immediate lv_query;',
'      END IF;',
'    END LOOP;',
'  ELSE',
'    FOR rec_tables_disabled IN cur_tables_disabled',
'    LOOP',
'      -- Check trigger exists',
'      SELECT COUNT(1)',
'      INTO ln_count',
'      FROM all_triggers',
'      WHERE trigger_name = rec_tables_disabled.table_name',
'        ||''_TRG''',
'      AND table_name = rec_tables_disabled.table_name;',
'      -- If trigger exists',
'      IF ln_count > 0 THEN',
'        -- Check if trigger is Enabled or Disabled',
'        SELECT COUNT(1)',
'        INTO ln_count',
'        FROM all_triggers',
'        WHERE trigger_name = rec_tables_disabled.table_name',
'          ||''_TRG''',
'        AND table_name = rec_tables_disabled.table_name',
'        AND status     = ''ENABLED'';',
'        -- If trigger is enabled',
'        IF ln_count > 0 THEN',
'          -- Disable trigger',
'          lv_query := ''ALTER TRIGGER ''||rec_tables_disabled.table_name||''_TRG DISABLE'';',
'          EXECUTE immediate lv_query;',
'        END IF;',
'      END IF;',
'    END LOOP;',
'  END IF;',
'END create_history_objects;',
'END ad_history_pkg;',
