'CREATE OR REPLACE PACKAGE "AD_AUTHENTICATION_PKG" ',
'AS',
'  /* ***************************************************************************',
'  -- ------------------------------------------------------------------------',
'  -- Package Name        : AD_AUTHENTICATION_PKG',
'  -- Company             : Acolyte',
'  -- Author              : Abhishek Arora',
'  -- ------------------------------------------------------------------------',
'  -- Description...',
'  -- This package contians the code related to authentication of users in the',
'  -- application.',
'  -- ------------------------------------------------------------------------',
'  -- Revision History...',
'  -- -----------  ---------------  ------------------------------------------',
'  -- Date         Author           Change',
'  -- -----------  ---------------  ------------------------------------------',
'  -- 02-AUG-2015  Abhishek         Created Package',
'  -- ------------------------------------------------------------------------',
'  *************************************************************************** */',
'  FUNCTION AD_AUTHENTICATION(',
'      P_USERNAME IN VARCHAR2,',
'      P_PASSWORD IN VARCHAR2)',
'    RETURN BOOLEAN;',
'END AD_AUTHENTICATION_PKG;',
'/',
'',
'',
'CREATE OR REPLACE PACKAGE BODY "AD_AUTHENTICATION_PKG" ',
'AS',
'  /* ***************************************************************************',
'  -- ------------------------------------------------------------------------',
'  -- Function Name       : AD_AUTHENTICATION',
'  -- ------------------------------------------------------------------------',
'  -- Description...',
'  -- This package contians the code related to authentication of users in the',
'  -- application.',
'  -- ------------------------------------------------------------------------',
'  -- Parameters...',
'  -- ---------------  -----  ------------------------------------------------',
'  -- Paramter Name    Type   Description',
'  -- ---------------  -----  ------------------------------------------------',
'  -- P_USERNAME       IN     Username',
'  -- P_PASSWORD       IN     Password',
'  -- ---------------  -----  ------------------------------------------------',
'  *************************************************************************** */',
'FUNCTION AD_AUTHENTICATION(',
'    P_USERNAME IN VARCHAR2,',
'    P_PASSWORD IN VARCHAR2)',
'  RETURN BOOLEAN',
'AS',
'  LN_DUMMY NUMBER;',
'BEGIN',
'  -- Select statement to check if the username and password exists in AD_USERS Table.',
'  SELECT 1',
'  INTO LN_DUMMY',
'  FROM AD_USERS',
'  WHERE UPPER (USER_NAME) = UPPER (P_USERNAME)',
'  AND PASSWORD            = DBMS_OBFUSCATION_TOOLKIT.MD5 ( INPUT_STRING => UPPER (TRIM (P_USERNAME))',
'    || ''/''',
'    || UPPER (P_PASSWORD))',
'  AND ENABLED = ''Y''',
'  AND SYSDATE BETWEEN NVL (DATE_FROM, SYSDATE) AND NVL (DATE_TO, SYSDATE);',
'  -- Return true when user is found',
'  RETURN TRUE;',
'EXCEPTION',
'WHEN OTHERS THEN',
'  -- Return false when user is not found',
'  RETURN FALSE;',
'END AD_AUTHENTICATION;',
'END AD_AUTHENTICATION_PKG;',
'/',
'',
'CREATE OR REPLACE PACKAGE "AD_APPLICATION_PKG" ',
'AS',
'  /* ***************************************************************************',
'  -- ------------------------------------------------------------------------',
'  -- Package Name        : AD_APPLICATION_PKG',
'  -- Company             : Acolyte',
'  -- Author              : Abhishek Arora',
'  -- ------------------------------------------------------------------------',
'  -- Description...',
'  -- This package contians the code related to applications tables.',
'  -- ------------------------------------------------------------------------',
'  -- Revision History...',
'  -- -----------  ---------------  ------------------------------------------',
'  -- Date         Author           Change',
'  -- -----------  ---------------  ------------------------------------------',
'  -- 06-AUG-2015  Abhishek         Created Package',
'  -- ------------------------------------------------------------------------',
'  *************************************************************************** */',
'  FUNCTION AD_APPLICATION_ID(',
'      P_APP_ID IN NUMBER)',
'    RETURN NUMBER;',
'END AD_APPLICATION_PKG;',
'/',
'',
'',
'CREATE OR REPLACE PACKAGE BODY "AD_APPLICATION_PKG" ',
'AS',
'  /* ***************************************************************************',
'  -- ------------------------------------------------------------------------',
'  -- Function Name       : AD_APPLICATION_ID',
'  -- ------------------------------------------------------------------------',
'  -- Description...',
'  -- This function returns APPLICATION_ID for a given apex APP_ID.',
'  -- ------------------------------------------------------------------------',
'  -- Parameters...',
'  -- ---------------  -----  ------------------------------------------------',
'  -- Paramter Name    Type   Description',
'  -- ---------------  -----  ------------------------------------------------',
'  -- P_APP_ID         IN     Oracle Apex APP_ID',
'  -- ---------------  -----  ------------------------------------------------',
'  *************************************************************************** */',
'FUNCTION AD_APPLICATION_ID(',
'    P_APP_ID IN NUMBER)',
'  RETURN NUMBER',
'AS',
'  LN_APPLICATION_ID AD_APPLICATIONS.APPLICATION_ID%TYPE;',
'BEGIN',
'  -- Select statement to get application id.',
'  SELECT APPLICATION_ID',
'  INTO LN_APPLICATION_ID',
'  FROM AD_APPLICATIONS',
'  WHERE APEX_APPLICATION_ID = P_APP_ID',
'  AND ENABLED               = ''Y''',
'  AND SYSDATE BETWEEN NVL (DATE_FROM, SYSDATE) AND NVL (DATE_TO, SYSDATE);',
'  -- Return profile value',
'  RETURN (LN_APPLICATION_ID);',
'EXCEPTION',
'WHEN OTHERS THEN',
'  -- Return null when no value is found',
'  RETURN NULL;',
'END AD_APPLICATION_ID;',
'END AD_APPLICATION_PKG;',
'/',
'',
''))
);
